goog.provide("goog.events.EventTargetTest");goog.setTestOnly("goog.events.EventTargetTest");goog.require("goog.events.EventTarget");goog.require("goog.events.Listenable");goog.require("goog.events.eventTargetTester");goog.require("goog.events.eventTargetTester.KeyType");goog.require("goog.events.eventTargetTester.UnlistenReturnType");goog.require("goog.testing.jsunit");function setUp(){var newListenableFn=function(){return new goog.events.EventTarget},listenFn=function(src,type,listener,opt_capt,opt_handler){return src.listen(type,listener,opt_capt,opt_handler)},unlistenFn=function(src,type,listener,opt_capt,opt_handler){return src.unlisten(type,listener,opt_capt,opt_handler)},unlistenByKeyFn=function(src,key){return src.unlistenByKey(key)},listenOnceFn=function(src,type,listener,opt_capt,opt_handler){return src.listenOnce(type,listener,opt_capt,opt_handler)},dispatchEventFn=function(src,e){return src.dispatchEvent(e)},removeAllFn=function(src,opt_type,opt_capture){return src.removeAllListeners(opt_type,opt_capture)},getListenersFn=function(src,type,capture){return src.getListeners(type,capture)},getListenerFn=function(src,type,listener,capture,opt_handler){return src.getListener(type,listener,capture,opt_handler)},hasListenerFn=function(src,opt_type,opt_capture){return src.hasListener(opt_type,opt_capture)};goog.events.eventTargetTester.setUp(newListenableFn,listenFn,unlistenFn,unlistenByKeyFn,listenOnceFn,dispatchEventFn,removeAllFn,getListenersFn,getListenerFn,hasListenerFn,goog.events.eventTargetTester.KeyType.NUMBER,goog.events.eventTargetTester.UnlistenReturnType.BOOLEAN,!1)}function tearDown(){goog.events.eventTargetTester.tearDown()}function testRuntimeTypeIsCorrect(){var target=new goog.events.EventTarget;assertTrue(goog.events.Listenable.isImplementedBy(target))}